Demon Dog (2013) (Digital) (Darkness-Empire) [By Derek Charm]

Not to be confused with the Marvel canine. A self-published comic by New York-based artist Derek Charm.


NOTE: The writer/artist has said that at the time being, this is a one-shot, which is why I have removed the issue number from the title, so as not to confuse people who would otherwise be waiting for issue two to arrive. However, that is subject to change, and more issues might be released in the future.

